import React from "react";
import { AboutСontainer } from "./style";
import Data from "Entites/Data";
import phoneMask from "Features/phoneMask";
import styled from "styled-components";

export default function AboutPerson() {
  const {
    main_number,
    first_number,
    second_number,
    mail,
    site,
    address,
    addressСoordinates,
    dateOfBirth,
    rank,
  } = Data.person;

  const InfoLink = styled.a`
    display: block;
  `;
  return (
    <AboutСontainer>
      <InfoLink>{phoneMask(main_number)}</InfoLink>
      <InfoLink>{phoneMask(first_number)}</InfoLink>
      <InfoLink>{phoneMask(second_number)}</InfoLink>
    </AboutСontainer>
  );
}
